import styles from './Skills.module.css'

function Skills(){
    return( 
        <div className={styles.skill} id='Skills'>
            <h1>Habilidades</h1>
            <p>Conheça minhas habilidades e conhecimentos</p>
        </div>
    )
}

export default Skills
